import React from "react";
import Main from "../components/hostel/Main";
import Header from "../components/Home/Header";
import Main2 from "../components/hostel/Main2";

const Hostel = () => {
  return (
    <div className="App1">
      <Header />
      <Main />
      <Main2 />
    </div>
  );
};

export default Hostel;
